import ActionType,{IAction} from '../../types/constant'

interface EmployeeReducerState {
    nickname: string
    checkIn: string
    checkOut:string
    password: string
    note: string
}
const initialState:EmployeeReducerState = {
    nickname:'',
    checkIn: '',
    checkOut:'',
    password:'',
    note:'',
}
 function EmployeeReducer ( state: EmployeeReducerState =  initialState, action: IAction<any>){
    switch(action.type){
        case ActionType.GET_USERS:
        return {
            ...state,
            nickname:action.payload,
            checkIn:action.payload,
            checkOut:action.payload,
            password:action.payload,
            note:action.payload,
        }
        default: return state
    }
 }

 export default EmployeeReducer
